import logo from "./orebiLogo.png";
import logoLight from "./logoLight.png";
import bannerImgOne from "./banner/bannerImgOne.png";
import bannerImgTwo from "./banner/bannerImgTwo.png";
import bannerImgThree from "./banner/bannerImgThree.png";
import saleImgOne from "./sale/saleImgOne.png";
import saleImgTwo from "./sale/saleImgTwo.png";
import saleImgThree from "./sale/saleImgThree.png";
// ============== Products Start here ====================
// New Arrivals
import newArrOne from "./products/newArrival/newArrOne.png";
import newArrTwo from "./products/newArrival/newArrTwo.png";
import newArrThree from "./products/newArrival/newArrThree.png";
import newArrFour from "./products/newArrival/newArrFour.png";

// Best Sellers
import bestSellerOne from "./products/bestSeller/bestSellerOne.png";
import bestSellerTwo from "./products/bestSeller/bestSellerTwo.png";
import bestSellerThree from "./products/bestSeller/bestSellerThree.webp";
import bestSellerFour from "./products/bestSeller/bestSellerFour.webp";

// Special Offers
import spfOne from "./products/specialOffer/spfOne.png";
import spfTwo from "./products/specialOffer/spfTwo.webp";
import spfThree from "./products/specialOffer/spfThree.webp";
import spfFour from "./products/specialOffer/spfFour.webp";

// Year Product
import productOfTheYear from "./products/productOfTheYear.png";
// ============== Products End here ======================
import paymentCard from "./payment.png";
import emptyCart from "../images/emptyCart.png";

export {
  logo,
  logoLight,
  bannerImgOne,
  bannerImgTwo,
  bannerImgThree,
  saleImgOne,
  saleImgTwo,
  saleImgThree,
  // ===================== Products start here ============
  // New Arrivals
  newArrOne,
  newArrTwo,
  newArrThree,
  newArrFour,

  // Best Sellers
  bestSellerOne,
  bestSellerTwo,
  bestSellerThree,
  bestSellerFour,

  // Sprcial Offers
  spfOne,
  spfTwo,
  spfThree,
  spfFour,

  // Year Product
  productOfTheYear,
  // ===================== Products End here ==============
  paymentCard,
  emptyCart,
};
